import React from 'react';
import {
  BrowserRouter as Router, Route, Switch,
} from 'react-router-dom';
import Routes from './routes/index';

import NavigationBar from './layouts/Principal';

const App = () => (
  <div>
    <NavigationBar />
    <Router>
      <Switch>
        {Routes.map((route) => (
          <Route exact path={route.path} key={route.path}>
            <route.component />
          </Route>
        ))}
      </Switch>
    </Router>
  </div>
);

export default App;
